import React, { Component, useState, useEffect } from "react";

import api from "../services/api";

export default class Movie extends Component {

    constructor(props) {
      super(props);

      this.state = { moviesCollection: [] };
  }

  componentDidMount() {
    api.getMovies()
      .then(res => {
        this.setState({ moviesCollection: res.data });
      })
      .catch(function (error) {
        console.log(error);
    })
  }

  render() {
    <div>
      <table className="table">
        <thead>
          <tr>
            <th scope="col">#</th>
            <th scope="col">Title</th>
            <th scope="col">Year</th>
            <th scope="col">imDbRating</th>
            <th scope="col">Poster</th>
          </tr>
        </thead>
        <tbody>
          {this.state.moviesCollection.map(movie => (
            <tr key={movie.imdbID}>
              <th scope="row">{movie.imdbID}</th>
              <td>{movie.Title}</td>
              <td>{movie.Year}</td>
              <td>{movie.imdbRating}</td>
              <td><img src={movie.Poster} alt="Movie" /></td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  }

}
